import {
  Title,
  IncomeExpense,
  NewTransactionForm,
  TransactionList,
} from "../components";

import Balance from "../components/Balance";

const Home = () => {
  return (
    <div className="home">
      <div className="container">
        {/* <Balance /> */}
        <IncomeExpense />
        <TransactionList />
        <NewTransactionForm />
      </div>
    </div>
  );
};

export default Home;
